function extraerPreciosDinamico(medico) {
  var precios = {};
  precios.consulta_base = medico.consulta || 0;

  var textoCompleto = (medico.nota || '') + ' ' +
(medico.notaWeb || '');
  var textoUpper = textoCompleto.toUpperCase();

  if (textoUpper.indexOf('PARTICULAR') !== -1) {
    var particularIndex = textoUpper.indexOf('PARTICULAR$');
    if (particularIndex !== -1) {
      var afterParticular =
textoUpper.substring(particularIndex + 12);
      var numberMatch = afterParticular.match(/\d+/);
      if (numberMatch) {
        precios.particular = parseInt(numberMatch[0]);
      }
    }
  }

  if (textoUpper.indexOf('PAMI') !== -1) {
    var pamiIndex = textoUpper.indexOf('PAMI');
    if (pamiIndex !== -1) {
      var afterPami = textoUpper.substring(pamiIndex + 4);
      var numberMatch = afterPami.match(/\d+/);
      if (numberMatch) {
        precios.pami = parseInt(numberMatch[0]);
      }
    }
  }

  return precios;
}

