function normalizarPrecio(valor) {
  valor = (valor !== undefined && valor !== null) ? String(valor) : "";

  if (!valor || valor === "‚Äì" || valor.trim() === "") return "No informado";

  if (!valor.trim().startsWith("$") && valor.includes("$")) {
    valor = valor.substring(valor.indexOf("$"));
  }

  return valor.replace(/\$[\d\.,]+/g, (match) => {
    let monto = match.replace("$", "");
    monto = monto.replace(/(\.|,)?00$/, "");
    if (monto.includes(",") && monto.includes(".")) {
      monto = monto.replace(",", ".").replace(/\.\d{2}$/, "");
    } else if (monto.match(/^\d{1,3}(,\d{3})+(\.\d+)?$/)) {
      monto = monto.replace(/,/g, ".").replace(/\.\d+$/, "");
    } else if (monto.match(/^\d{1,3}(\.\d{3})+(\,\d+)?$/)) {
      monto = monto.replace(/\,\d+$/, "");
    } else if (monto.match(/^\d+(\.\d+)?$/)) {
      monto = monto.replace(/\.00$/, "");
    } else if (monto.match(/^\d+(\,\d+)?$/)) {
      monto = monto.replace(/\,00$/, "");
    }
    monto = monto.replace(/\.00$/, "").replace(/\,00$/, "");
    return "$" + monto;
  });
}

